import axios from 'axios';

export default registration = async(email, password) => {
    try {
        const responce = await axios.post(`http://localhost:5000/api/auth/registration`, {
            email, passsword
        })
        alert(responce.data.message)
    } catch (error) {
        alert(error)
    }
}
